              "videoId": "yuD34tEpRFw",
              "textDisplay": "It is not accurate to say that Einstein &quot;made up some bullsh*t&quot; because he couldn&#39;t disprove his idols&#39; findings. In fact, Einstein&#39;s theories of relativity were based on rigorous mathematical and scientific reasoning, and have been extensively tested and verified through experiments.\r\u003cbr\u003e\r\u003cbr\u003eThe theories of relativity were developed in response to certain inconsistencies and paradoxes in classical physics, such as the Michelson-Morley experiment, which could not be explained by existing theories. Einstein&#39;s theories of relativity resolved these inconsistencies and provided a more accurate and comprehensive framework for understanding the behavior of matter and energy in the universe.\r\u003cbr\u003e\r\u003cbr\u003eIt is also not accurate to say that the explanations provided by Einstein do not make sense. While some of the concepts and terminology used in relativity may be difficult to grasp at first, they are based on sound scientific principles and have been demonstrated through numerous experiments and observations.\r\u003cbr\u003e\r\u003cbr\u003eFurthermore, while quantum mechanics and relativity are both highly successful theories in their respective domains, they are not incompatible or contradictory. In fact, efforts to reconcile these two theories have led to some of the most exciting and active areas of research in physics today.\r\u003cbr\u003e\r\u003cbr\u003eTherefore, it is important to approach these topics with an open mind and a willingness to learn, rather than dismissing them as &quot;nonsensical jargon&quot;.",
